import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Stack from '@mui/material/Stack';

export default function AddUserForm() {
  return (
    <form>
      <Stack direction="row" spacing={2} alignItems="center" justifyContent="center">

        <TextField label="User Name" variant="filled" color="success" focused />
        <TextField label="Group" variant="filled" color="success" focused inputProps={{ readOnly: true, }}/>
        <TextField label="Color" variant="filled" color="success" focused />
      </Stack>
    </form>
  )
}
